                <h2> LOGIN </h2>
                <label htmlFor=""> Usuario </label>
                <input type="text" />
                <label htmlFor=""> Contraseña </label>
                <input type="password" />
                <p> ¿ No tienes una cuenta ? <span>Resgistrate</span></p>
                <button className="ingresar"> Ingresar </button>
            </form>
            
        </section>
    );
}
